import React from 'react';
import LogoImg from '../../assets/images/logo.svg';
import landingImg from '../../assets/images/landing.svg';
import StudyIco from '../../assets/images/icon/study.svg';
import giveClassesIcon from '../../assets/images/icon/give-classes.svg';

function Landing() {
return (
    <div id="page-landing">
    <div id="page-landing-content" className="container">
        <div id="logo-container">
            <img src={LogoImg} alt="Coder"/>
            <h2>Plataforma de Coders On-line</h2>
        </div>

        <img 
        src={landingImg} 
        alt="Plataforma de Coders" 
        className="hero-image"
        />

        <div className="buttons-container">

            <a href="" className="study">
            <img src={StudyIco} alt="Estudar" />   
            Estudar             
            </a>

            <a href="" className="give-classes">
            <img src={giveClassesIcon} alt="Dar Aulas" />   
            Estudar             
            </a>

        </div>

    </div>
</div>
)
}

export default Landing;
